import React from 'react';

const Navbar = () => {
    return(
        <nav className="navbar">
            <ul>
                <li>
                    Home
                </li>
                <li>
                    Contacto
                </li>
                <li>
                    About
                </li>
            </ul>
        </nav>
    )
}

export default Navbar;
